async function handleRequest(t){const e=JSON.parse(JSON.parse(hpp_config)),s=e.hpp_account_identifier,a=e.hpp_script_name,n=e.hpp_CF_Auth_Key,i=e.hpp_Auth_Email,p={body:await(await fetch("https://raw.githubusercontent.com/HexoPlusPlus/HexoPlusPlus/main/worker/dist/main.js")).text(),method:"PUT",headers:{"content-type":"application/javascript","X-Auth-Key":n,"X-Auth-Email":i}},c=await(await fetch(`https://api.cloudflare.com/client/v4/accounts/${s}/workers/scripts/${a}`,p)).text();return new Response(JSON.parse(c).success)}addEventListener("fetch",(t=>{t.respondWith(handleRequest(t.request))}));